const MDXLayout = "wrapper"
export default function MDXContent({
  components,
  ...props
}) {
  return <MDXLayout {...layoutProps} {...props} components={components} mdxType="MDXLayout">


    <p>{`The Vector `}<inlineCode parentName="p">{`json_parser`}</inlineCode>{` transform
accepts and outputs `}<a parentName="p" {...{
        "href": "/docs/about/data-model/log/"
      }}><inlineCode parentName="a">{`log`}</inlineCode></a>{` events, allowing you to parse
a log field value as JSON.`}</p>
    {
      /*
          THIS FILE IS AUTOGENERATED!
           To make changes please edit the template located at:
           website/docs/reference/transforms/json_parser.md.erb
      */
    }
    <h2 {...{
      "id": "configuration"
    }}>{`Configuration`}</h2>
    <Tabs block={true} defaultValue="common" values={[{
      "label": "Common",
      "value": "common"
    }, {
      "label": "Advanced",
      "value": "advanced"
    }]} mdxType="Tabs">
      <TabItem value="common" mdxType="TabItem">
        <pre><code parentName="pre" {...{
            "className": "language-toml",
            "metastring": "title=\"vector.toml\"",
            "title": "\"vector.toml\""
          }}>{`[transforms.my_transform_id]
  type = "json_parser" # required
  inputs = ["my-source-or-transform-id"] # required
  drop_field = true # optional, default
  drop_invalid = true # required
  field = "message" # optional, default
`}</code></pre>
      </TabItem>
      <TabItem value="advanced" mdxType="TabItem">
        <pre><code parentName="pre" {...{
            "className": "language-toml",
            "metastring": "title=\"vector.toml\"",
            "title": "\"vector.toml\""
          }}>{`[transforms.my_transform_id]
  type = "json_parser" # required
  inputs = ["my-source-or-transform-id"] # required
  drop_field = true # optional, default
  drop_invalid = true # required
  field = "message" # optional, default
  overwrite_target = false # optional, default
  target_field = "root_field" # optional, no default
`}</code></pre>
      </TabItem>
    </Tabs>
    <Fields filters={true} mdxType="Fields">
      <Field common={true} defaultValue={true} enumValues={null} examples={[true, false]} groups={[]} name={"drop_field"} path={null} relevantWhen={null} required={false} templateable={false} type={"bool"} unit={null} warnings={[]} mdxType="Field">
        <h3 {...{
          "id": "drop_field"
        }}>{`drop_field`}</h3>
        <p>{`If the specified `}<a parentName="p" {...{
            "href": "#field"
          }}><inlineCode parentName="a">{`field`}</inlineCode></a>{` should be dropped (removed) after parsing. If parsing
fails, the field will not be removed, irrespective of this setting.`}</p>
      </Field>
      <Field common={true} defaultValue={null} enumValues={null} examples={[true]} groups={[]} name={"drop_invalid"} path={null} relevantWhen={null} required={true} templateable={false} type={"bool"} unit={null} warnings={[]} mdxType="Field">
        <h3 {...{
          "id": "drop_invalid"
        }}>{`drop_invalid`}</h3>
        <p>{`If `}<inlineCode parentName="p">{`true`}</inlineCode>{` events with invalid JSON will be dropped, otherwise the event will be
kept and passed through.
See `}<a parentName="p" {...{
            "href": "#invalid-json"
          }}>{`Invalid JSON`}</a>{` for more info.`}</p>
      </Field>
      <Field common={true} defaultValue={"message"} enumValues={null} examples={["message", "parent.child", "array[0]"]} groups={[]} name={"field"} path={null} relevantWhen={null} required={false} templateable={false} type={"string"} unit={null} warnings={[]} mdxType="Field">
        <h3 {...{
          "id": "field"
        }}>{`field`}</h3>
        <p>{`The log field to decode as JSON. Must be a `}<inlineCode parentName="p">{`string`}</inlineCode>{` value type.
See `}<a parentName="p" {...{
            "href": "#field-notation-syntax"
          }}>{`Field Notation Syntax`}</a>{` and `}<a parentName="p" {...{
            "href": "#invalid-json"
          }}>{`Invalid JSON`}</a>{` for more info.`}</p>
      </Field>
      <Field common={false} defaultValue={false} enumValues={null} examples={[false, true]} groups={[]} name={"overwrite_target"} path={null} relevantWhen={null} required={false} templateable={false} type={"bool"} unit={null} warnings={[]} mdxType="Field">
        <h3 {...{
          "id": "overwrite_target"
        }}>{`overwrite_target`}</h3>
        <p>{`If `}<a parentName="p" {...{
            "href": "#target_field"
          }}><inlineCode parentName="a">{`target_field`}</inlineCode></a>{` is set and the log contains a field of the same name as the
target, it will only be overwritten if this is set to `}<inlineCode parentName="p">{`true`}</inlineCode>{`.`}</p>
      </Field>
      <Field common={false} defaultValue={null} enumValues={null} examples={["root_field", "parent.child"]} groups={[]} name={"target_field"} path={null} relevantWhen={null} required={false} templateable={false} type={"string"} unit={null} warnings={[]} mdxType="Field">
        <h3 {...{
          "id": "target_field"
        }}>{`target_field`}</h3>
        <p>{`If this setting is present, the parsed JSON will be inserted into the log as a
sub-object with this name. If a field with the same name already exists, the
parser will fail and produce an error.
See `}<a parentName="p" {...{
            "href": "#field-notation-syntax"
          }}>{`Field Notation Syntax`}</a>{` for more info.`}</p>
      </Field>
    </Fields>
    <h2 {...{
      "id": "examples"
    }}>{`Examples`}</h2>
    <Tabs block={true} defaultValue="simple" select={false} values={[{
      "label": "Simple",
      "value": "simple"
    }, {
      "label": "Wrapped",
      "value": "wrapped"
    }]} mdxType="Tabs">
      <TabItem value="simple" mdxType="TabItem">
        <p>{`Given the following log event:`}</p>
        <pre><code parentName="pre" {...{
            "className": "language-javascript"
          }}>{`{
  "message": "{"key": "value"}"
}
`}</code></pre>
        <p>{`You can parse the JSON with:`}</p>
        <pre><code parentName="pre" {...{
            "className": "language-toml"
          }}>{`[transforms.json]
  inputs = ["<source_id>"]
  type   = "json_parser"
  field  = "message"
`}</code></pre>
        <p>{`This would produce the following event as output:`}</p>
        <pre><code parentName="pre" {...{
            "className": "language-javascript"
          }}>{`{
  "key": "value"
}
`}</code></pre>
        <p>{`By default, Vector drops fields after parsing them via the `}<a parentName="p" {...{
            "href": "#drop_field"
          }}><inlineCode parentName="a">{`drop_field`}</inlineCode></a>{`
option.`}</p>
      </TabItem>
      <TabItem value="wrapped" mdxType="TabItem">
        <p>{`It is possible to chain `}<inlineCode parentName="p">{`json_parser`}</inlineCode>{` transforms to effectively "unwrap"
nested JSON documents. For example, give this log event:`}</p>
        <pre><code parentName="pre" {...{
            "className": "language-javascript"
          }}>{`{
  "message": "{"parent": "{"child": "value2"}"}"
}
`}</code></pre>
        <p>{`You could unwrap the JSON with the following transforms:`}</p>
        <pre><code parentName="pre" {...{
            "className": "language-toml"
          }}>{`[transforms.root_json]
  inputs = ["<source_id>"]
  type   = "json_parser"
  field  = "message"

[transforms.parent_json]
  inputs = ["root_json"]
  type   = "json_parser"
  field  = "parent"

[transforms.child_json]
  inputs = ["parent_json"]
  type   = "json_parser"
  field  = "child"
`}</code></pre>
        <p>{`This would produce the following event as output:`}</p>
        <pre><code parentName="pre" {...{
            "className": "language-javascript"
          }}>{`{
  "child": "value2"
}
`}</code></pre>
        <p>{`By default, Vector drops fields after parsing them via the `}<a parentName="p" {...{
            "href": "#drop_field"
          }}><inlineCode parentName="a">{`drop_field`}</inlineCode></a>{`
option.`}</p>
      </TabItem>
    </Tabs>
    <h2 {...{
      "id": "how-it-works"
    }}>{`How It Works`}</h2>
    <h3 {...{
      "id": "chaining--unwrapping"
    }}>{`Chaining / Unwrapping`}</h3>
    <p>{`Please see the `}<a parentName="p" {...{
        "href": "#examples"
      }}>{`Examples section`}</a>{`.`}</p>
    <h3 {...{
      "id": "complex-processing"
    }}>{`Complex Processing`}</h3>
    <p>{`If you encounter limitations with the `}<inlineCode parentName="p">{`json_parser`}</inlineCode>{`
transform then we recommend using a `}<a parentName="p" {...{
        "href": "https://vector.dev/components/?functions%5B%5D=program"
      }}>{`runtime transform`}</a>{`.
These transforms are designed for complex processing and give you the power of
full programming runtime.`}</p>
    <h3 {...{
      "id": "environment-variables"
    }}>{`Environment Variables`}</h3>
    <p>{`Environment variables are supported through all of Vector's configuration.
Simply add `}<inlineCode parentName="p">{`\${MY_ENV_VAR}`}</inlineCode>{` in your Vector configuration file and the variable
will be replaced before being evaluated.`}</p>
    <p>{`You can learn more in the
`}<a parentName="p" {...{
        "href": "/docs/setup/configuration/#environment-variables"
      }}>{`Environment Variables`}</a>{` section.`}</p>
    <h3 {...{
      "id": "field-notation-syntax"
    }}>{`Field Notation Syntax`}</h3>
    <p>{`The `}<a parentName="p" {...{
        "href": "#field"
      }}><inlineCode parentName="a">{`field`}</inlineCode></a>{` and `}<a parentName="p" {...{
        "href": "#target_field"
      }}><inlineCode parentName="a">{`target_field`}</inlineCode></a>{` options
support `}<a parentName="p" {...{
        "href": "/docs/reference/field-path-notation/"
      }}>{`Vector's field notation syntax`}</a>{`,
enabling access to root-level, nested, and array field values. For example:`}</p>
    <pre><code parentName="pre" {...{
        "className": "language-toml",
        "metastring": "title=\"vector.toml\"",
        "title": "\"vector.toml\""
      }}>{`[transforms.my_json_parser_transform_id]
  # ...
  field = "message"
  field = "parent.child"
  field = "array[0]"
  # ...
`}</code></pre>
    <p>{`You can learn more about Vector's field notation in the
`}<a parentName="p" {...{
        "href": "/docs/reference/field-path-notation/"
      }}>{`field notation reference`}</a>{`.`}</p>
    <h3 {...{
      "id": "invalid-json"
    }}>{`Invalid JSON`}</h3>
    <p>{`If the value for the specified `}<a parentName="p" {...{
        "href": "#field"
      }}><inlineCode parentName="a">{`field`}</inlineCode></a>{` is not valid JSON you can control keep
or discard the event with the `}<a parentName="p" {...{
        "href": "#drop_invalid"
      }}><inlineCode parentName="a">{`drop_invalid`}</inlineCode></a>{` option. Setting it to `}<inlineCode parentName="p">{`true`}</inlineCode>{` will
discard the event and drop it entirely. Setting it to `}<inlineCode parentName="p">{`false`}</inlineCode>{` will keep the
event and pass it through. Note that passing through the event could cause
problems and violate assumptions about the structure of your event.`}</p>
    <h3 {...{
      "id": "merge-conflicts"
    }}>{`Merge Conflicts`}</h3>
    <h4 {...{
      "id": "key-conflicts"
    }}>{`Key conflicts`}</h4>
    <p>{`Any key present in the decoded JSON will override existin keys in the event.`}</p>
    <h4 {...{
      "id": "object-conflicts"
    }}>{`Object conflicts`}</h4>
    <p>{`If the decoded JSON includes nested fields it will be `}<em parentName="p">{`deep`}</em>{` merged into the
event. For example, given the following event:`}</p>
    <pre><code parentName="pre" {...{
        "className": "language-javascript"
      }}>{`{
  "message": "{\\"parent\\": {\\"child2\\": \\"value2\\"}}",
  "parent": {
    "child1": "value1"
  }
}
`}</code></pre>
    <p>{`Parsing the `}<inlineCode parentName="p">{`"message"`}</inlineCode>{` field would result the following structure:`}</p>
    <pre><code parentName="pre" {...{
        "className": "language-javascript"
      }}>{`{
  "parent": {
    "child1": "value1",
    "child2": "value2"
  }
}
`}</code></pre>
    <p>{`Notice that the `}<inlineCode parentName="p">{`parent.child1`}</inlineCode>{` key was preserved.`}</p>
    </MDXLayout>;
}

